import React from "react";
import "./Perception.css";
import LevelLayout from "../../components/Levels/LevelLayout.js";

function Perception() {
  const isBackgroundWhite = true;
  return (
    <div>
      <LevelLayout title="level 1: perception"></LevelLayout>
      style={{ backgroundColor: isBackgroundWhite ? "white" : "df7260" }}
    </div>
  );
}

export default Perception;

